import React, { useState } from 'react';
import {
  View, TextInput, TouchableOpacity, Image,
} from 'react-native';
import garbageIcon from '../../../images/garbage-icon.png';

export default function ListRow({
  value, styles, changeListValue, listCategory,
  itemModalProperties, setItemModalProperties,
}) {
  const [editValue, seteditValue] = useState(value.title);
  return (
    <View style={styles.addItemModal__block__row}>
      <View style={styles.addItemModal__row__name}>
        <TextInput
          placeholder={listCategory}
          maxLength={30}
          multiline
          style={styles.addItemModal__inputText}
          autoCorrect={false}
          value={editValue}
          onChangeText={(text) => {
            seteditValue(text);
            changeListValue(editValue, listCategory, text);
          }}
        />
      </View>
      <TouchableOpacity
        style={styles.addItemModal__row__garbage}
        onPress={() => {
          deleteListValue(
            itemModalProperties, value.uniqueKey, setItemModalProperties,
          );
        }}
      >
        <Image source={garbageIcon} style={styles.garbageIcon} />
      </TouchableOpacity>
    </View>
  );
}
